// src/pages/PredictSingle.jsx
import React, { useState } from "react";
import TopNav from "../components/TopNav";
import { predictSingle } from "../services/api";
import { Button, Card, Container, Form, Row, Col } from "react-bootstrap";

export default function PredictSingle() {
  const [form, setForm] = useState({
    name: "Test Student",
    district: "Chennai",
    cutoff: 2000,
    preferred_location: "chennai",
    preferred_course: "any",
    family_income_tier: "any",

    family_income: 5000,
    family_members: 4,

    marks_10: 450,
    marks_11: 430,
    marks_12: 440,

    motivational_score: 78,
    attendance_rate: 85,
    communication_freq: 6,
    interest_lvl: 7,
    family_support: 4,

    academic_score: 90,

    orphan: "no",
    single_parent: "no",
    first_graduate: "no",
    girlchild: "no",
    attitude: "positive",
  });

  const [response, setResponse] = useState(null);
  const [loading, setLoading] = useState(false);

  const update = (key, val) => {
    setForm((prev) => ({ ...prev, [key]: val }));
  };

  const callAPI = async () => {
    try {
      setLoading(true);
      const res = await predictSingle(form);
      setResponse(res);
    } catch (err) {
      console.error(err);
      setResponse({ error: "Failed to fetch prediction" });
    } finally {
      setLoading(false);
    }
  };

  return (
    <>
      <TopNav />
      <Container className="py-4">
        <Card className="p-4 shadow-sm" style={{ borderRadius: 14 }}>
          <h3>Simple Prediction Form</h3>
          <p>Edit the fields and send directly to /api/predict/single.</p>

          {/* SIMPLE FORM */}
          <Form>
            <Row>
              <Col md={6}>
                <Form.Group className="mb-3">
                  <Form.Label>Name</Form.Label>
                  <Form.Control
                    value={form.name}
                    onChange={(e) => update("name", e.target.value)}
                  />
                </Form.Group>
              </Col>

              <Col md={6}>
                <Form.Group className="mb-3">
                  <Form.Label>District</Form.Label>
                  <Form.Control
                    value={form.district}
                    onChange={(e) => update("district", e.target.value)}
                  />
                </Form.Group>
              </Col>
            </Row>

            <Row>
              <Col md={4}>
                <Form.Group className="mb-3">
                  <Form.Label>Cutoff</Form.Label>
                  <Form.Control
                    type="number"
                    value={form.cutoff}
                    onChange={(e) => update("cutoff", +e.target.value)}
                  />
                </Form.Group>
              </Col>

              <Col md={4}>
                <Form.Group className="mb-3">
                  <Form.Label>Preferred Location</Form.Label>
                  <Form.Control
                    value={form.preferred_location}
                    onChange={(e) =>
                      update("preferred_location", e.target.value)
                    }
                  />
                </Form.Group>
              </Col>

              <Col md={4}>
                <Form.Group className="mb-3">
                  <Form.Label>Preferred Course</Form.Label>
                  <Form.Control
                    value={form.preferred_course}
                    onChange={(e) =>
                      update("preferred_course", e.target.value)
                    }
                  />
                </Form.Group>
              </Col>
            </Row>

            {/* SIMPLE NUMBER INPUTS */}
            <Row>
              <Col md={4}>
                <Form.Group className="mb-3">
                  <Form.Label>Marks 10</Form.Label>
                  <Form.Control
                    type="number"
                    value={form.marks_10}
                    onChange={(e) => update("marks_10", +e.target.value)}
                  />
                </Form.Group>
              </Col>

              <Col md={4}>
                <Form.Group className="mb-3">
                  <Form.Label>Marks 11</Form.Label>
                  <Form.Control
                    type="number"
                    value={form.marks_11}
                    onChange={(e) => update("marks_11", +e.target.value)}
                  />
                </Form.Group>
              </Col>

              <Col md={4}>
                <Form.Group className="mb-3">
                  <Form.Label>Marks 12</Form.Label>
                  <Form.Control
                    type="number"
                    value={form.marks_12}
                    onChange={(e) => update("marks_12", +e.target.value)}
                  />
                </Form.Group>
              </Col>
            </Row>

            <Row>
              <Col md={4}>
                <Form.Group className="mb-3">
                  <Form.Label>Motivational Score</Form.Label>
                  <Form.Control
                    type="number"
                    value={form.motivational_score}
                    onChange={(e) =>
                      update("motivational_score", +e.target.value)
                    }
                  />
                </Form.Group>
              </Col>

              <Col md={4}>
                <Form.Group className="mb-3">
                  <Form.Label>Attendance Rate</Form.Label>
                  <Form.Control
                    type="number"
                    value={form.attendance_rate}
                    onChange={(e) =>
                      update("attendance_rate", +e.target.value)
                    }
                  />
                </Form.Group>
              </Col>

              <Col md={4}>
                <Form.Group className="mb-3">
                  <Form.Label>Academic Score</Form.Label>
                  <Form.Control
                    type="number"
                    value={form.academic_score}
                    onChange={(e) =>
                      update("academic_score", +e.target.value)
                    }
                  />
                </Form.Group>
              </Col>
            </Row>

            <Button onClick={callAPI} disabled={loading}>
              {loading ? "Predicting..." : "Predict"}
            </Button>
          </Form>

          <hr />

          <h5>Payload Sent:</h5>
          <pre>{JSON.stringify(form, null, 2)}</pre>

          <h5>ML Response:</h5>
          <pre>{JSON.stringify(response, null, 2)}</pre>
        </Card>
      </Container>
    </>
  );
}
